		"content": "\r\n<div class=\"entry\">\r\n\t<h1>{{title}}</h1>\r\n\t{{#if author}}\r\n\t<h2>{{author.firstName}} {{author.lastName}}</h2>\r\n\t{{else}}\r\n\t<h2>Unknown Author</h2>\r\n\t{{/if}}\r\n\t{{contentBody}}\r\n</div>\r\n\r\n{{#unless license}}\r\n  <h3 class=\"warning\">WARNING: This entry does not have a license!</h3>\r\n{{/unless}}\r\n\r\n<div class=\"footnotes\">\r\n\t<ul>\r\n\t\t{{#each footnotes}}\r\n\t\t<li>{{this}}</li>\r\n\t\t{{/each}}\r\n\t</ul>\r\n</div>\r\n\r\n<h1>Comments</h1>\r\n\r\n<div id=\"comments\">\r\n\t{{#each comments}}\r\n\t<h2><a href=\"/posts/{{../permalink}}#{{id}}\">{{title}}</a></h2>\r\n\t<div>{{body}}</div>\r\n\t{{/each}}\r\n</div>\r\n"
